import React, { useEffect, useState } from 'react';
import './Table.scss';
import TableItem from './TableItem';
import axios from 'axios';

function Table({ week }: { week: number }) {
  const userList = [
    { id: 'hyeonho28', tier: 'p' },
    { id: 'no13song', tier: 'g' },
    { id: 'kkomul1', tier: 'g' },
    { id: 'gwonllna', tier: 'g' },
    { id: 'tjfzjarlatlgus', tier: 'g' },
    { id: 'always216', tier: 'g' },
    { id: 'mjhee2647', tier: 's' },
    { id: 'lumicode', tier: 'g' },
    { id: 'theolee72', tier: 's' },
    { id: 'jungyun01', tier: 's' },
  ];
  // const userList = [{ id: 'hyeonho28', tier: 'p' }];
  // const problemList = [
  //   1309, 9278, 16132, 1735, 23048, 15897, 30194, 23041, 2673, 3012,
  // ];
  const [data, setData] = useState<Data>({ index: -10, data: [] });
  const [init, setInit] = useState(true);
  const [problemList, setProblemList] = useState<Problem[]>([]);

  useEffect(() => {
    if (init === true) {
      axios
        .get('http://localhost:5000/problem/' + week, {
          withCredentials: true,
        })
        .then((res) => {
          setProblemList([
            { id: 13171, tier: '', isChallenge: false },
            { id: 1890, tier: '', isChallenge: false },
            { id: 5582, tier: '', isChallenge: false },
            { id: 11985, tier: '', isChallenge: false },
            { id: 3673, tier: '', isChallenge: false },
            { id: 27435, tier: '', isChallenge: true },
            { id: 26142, tier: '', isChallenge: true },
            { id: 15554, tier: '', isChallenge: true },
            { id: 18443, tier: '', isChallenge: true },
            { id: 25490, tier: '', isChallenge: true },
          ]);
          setInit(false);
        });
    }
  }, [init]);

  useEffect(() => {
    console.log(problemList);
    if (problemList.length > 0) setData({ index: 0, data: [] });
  }, [problemList]);

  useEffect(() => {
    console.log(data);
    if (data.index >= 0 && data.index < userList.length) {
      const ele = userList[data.index];
      console.log(ele);
      try {
        axios
          .get('http://localhost:5000/submit/' + week + '/' + ele.id, {
            withCredentials: true,
          })
          .then((res) => {
            const row = problemList.map((elem) => {
              const filtered: Submit[] = res.data.filter((element: Submit) => {
                return Number(element.problemID) === elem.id;
              });
              if (
                filtered.filter((element: Submit) => {
                  return element['submitResult'] === 'ac';
                }).length > 0
              ) {
                return 'ac';
              } else {
                if (filtered.length === 0) return '';
                return filtered[0]['submitResult'];
              }
            });
            // console.log(row);
            setData((d: Data) => {
              return {
                index: d.index + 1,
                data: [...d.data, { user: ele, submitResult: row }],
              };
            });
          })
          .catch((err) => {
            console.log(err);
            setData((d: Data) => {
              return {
                index: d.index + 1,
                data: [...d.data, { user: ele, submitResult: [] }],
              };
            });
          });
      } catch (e) {
        console.log(e);
        setData((d: Data) => {
          return {
            index: d.index + 1,
            data: [...d.data, { user: ele, submitResult: [] }],
          };
        });
      }
    }
  }, [data]);

  return (
    <section className="ftco-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="table-wrap">
              <table className="table table-responsive-xl">
                <thead>
                  <tr>
                    <th>Username</th>
                    {problemList ? (
                      problemList.map((ele) => {
                        return <th>{ele.id}</th>;
                      })
                    ) : (
                      <></>
                    )}
                    <th className="table-space left">&nbsp;</th>
                    <th className="table-space">&nbsp;</th>
                    <th className="table-tax">누진세</th>
                  </tr>
                </thead>
                <tbody>
                  {data.data.map((ele) => {
                    return (
                      <TableItem
                        user={ele['user']}
                        submitResult={ele['submitResult']}
                        problemList={problemList}
                      />
                    );
                  })}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Table;
